import logo from './hulogo.png';
import './App.css';

function Header() {
    return (
      <header className="header">
        <img src={logo} alt="Hu Labs Logo" className="App-logo" />
            <h1>Automatic Joint Detection and SvH Scoring</h1>
      </header>
    );
  }
  export default Header;
